import "./Search.css";
import SearchPopup from "./SearchPopup/SearchPopup";
import ContentSearch from "./SearchList/SearchList";
import search from "./search.json";
import Navbar from "../home/NavBar/navbar.jsx";
import Card from "../home/Header/Card/Card.jsx";
import SearchContainer from "../home/Header/Search/search.jsx";
import Register from "../home/content/register/resgiter";
import Footer from "../home/footer/footer";
const Search = () => {
  return (
    // <div className="wrapper">
    //   <div className="container mt-2">
    //     <SearchPopup></SearchPopup>
    //     <ContentSearch search={search}></ContentSearch>
    //   </div>
    // </div>
    <div className="wrapper">
      <div className="navigation position-relative">
        <div className="container fs-3 text-white">
          <div className="mb-5">
            <Navbar></Navbar>
          </div>
          <div className="header">
            <Card></Card>
            <SearchContainer></SearchContainer>
          </div>
        </div>
      </div>
      <SearchPopup></SearchPopup>
      <ContentSearch search={search}></ContentSearch>
      <Register></Register>
      <div className="footer">
        <Footer></Footer>
      </div>
    </div>
  );
};

export default Search;
